				'id' => 76,
				'nome' => '#76 - Tarefas do blueblue it',
			'descricao' => '<p>**Tarefas Urgentes</p><p>Arrumar o contador de horas na tela inicial para exibir apenas horas referente aquele dia(e pular horas que continuam no dia seguinte)</p><p>No cadastro de cronograma, ordernar a lista de cronograma pelo jquery drag and drop</p><p>No cronograma, separar por data</p><p>**Tarefas</p><p>Organizar usuários/equipe por ordem alfabética;</p><p>Na lista de clientes, deve atualizar a aba de projetos</p><p>Na aba de tarefas, habilitar o filtro por data e por responsável</p><p>Na tarefa, criar uma tela para apenas visualizar a tarefa, sem ter os campos para editar.</p><p>- Criar um icone de nova tarefa ao lado da parada de mensagens(para ficar com esta opção em todas as páginas)</p><p>- não há mensagem de retorno para logins falhos, tarefas criadas, etc</p><p>- algumas telas quando cadastramos a tarefa não saem da tela atual, sendo necessário voltar manualmente.</p><p>- relatórios por esforço de colaborador, separado por colaborador por cliente, por colaborador por tipo de tarefa, etc</p><p>- relatório de cronogramas com tarefas que estão em atraso.</p><p>- Na tela principal mostrar de forma clara o que está atrasado ou não, principalmente em cronogramas.</p><p>Ex:</p><p>Projeto A - Etapa de Layout - 5 dias atrasado - último comentário da tarefa: 25/04</p><p>Projeto B - Kickoff - no prazo - último comentário da tarefa:&nbsp;</p><p><br></p><p><br></p><p>**Feitos</p><p>Correção do erro que não era possível criar tarefa de cronograma<br></p><p><span style="line-height: 17.1429px;">Criação de tarefa ongoing</span><br></p><p>Ajustar ícone de delete, colocar um "X" somente a cor vermelha não passa a intensão de exclusão.</p><p>Criar botão "nova tarefa" dentro do cadastro.</p><p>Incluir botão "novo cadastro" em toda página que exija esse comportamento, como ex.: Página de cadastro de tarefa.</p><p>Ao cadastrar novo projeto para clientes, ele deve puxar a lista de setores (projetos) cadastrados.</p><p>Ter a opção de clonagem de tarefa assim como o Run.</p><p>Fazer com que a seleção dos serviços apareça com a digitação do tipo de tarefa, como está hoje é preciso buscar por toda a lista até encontrar o tipo que quer.</p><p>No cadastro de tarefas: ter um botão atualizar junto dos dados da tarefa.</p><p>Colocar data na tela inicial para poder pesquisaras tarefas de todos por um tempo especifico</p><p>No cadastro de tarefas: Colocar a descrição data inicial e data de entrega para referenciar do que se trata cada campo de calendário.</p><p>Trocar dashbboard para painel</p><p>separar cronograma/tipo de tarefa das tarefas</p><p>Colocar um botão "ENTREGUE" na tarefa</p><p>Projetos(dentro de clientes) é na verdade um relacionamento com a equipe.</p><p>Ter opção de deletar tarefa dentro da própria tarefa</p><p>Otimizar a área de datas no cadastro de tarefa, a seleção de horas não permite a alteração manual, fazer como o Run.</p><p>Como o run: Inserir opção de cadastro de cliente e novo projeto durante o cadastro da tarefa.</p>',
